enc.FirstName = msg['PID']['PID.5']['PID.5.2'].toString().replace("'","''");
enc.EventDescription = $('EvtentTypeDescription');
enc.DOB = msg['PID']['PID.7']['PID.7.1'].toString();
enc.PhoneNumber = msg['PID']['PID.13']['PID.13.1'].toString();
var patientClass = msg['PV1']['PV1.2']['PV1.2.1'].toString();

switch(patientClass) {
  case "O":
    enc.PatientClass = "Outpatient";
    break;
  case "I":
    enc.PatientClass = "Inpatient";
        break;
  case "E":
    enc.PatientClass = "Emergency";
        break;
  case "P":
    enc.PatientClass = "Preadmit";
    break;
  default:
    enc.PatientClass = "Outpatient";
}
enc.SSN = msg['PID']['PID.19']['PID.19.1'].toString();
enc.InsuranceName = $('InsuranceName');
enc.InsuranceType = $('InsuranceType');
enc.InsurancePolicyNumber = $('InsurancePolicyNumber');
enc.EventType = msg['EVN']['EVN.1']['EVN.1.1'].toString();
enc.EventDate = msg['EVN']['EVN.2']['EVN.2.1'].toString();
enc.AdmissionDate = msg['PV1']['PV1.44']['PV1.44.1'].toString()
enc.AdmissionType = msg['PV1']['PV1.4']['PV1.4.1'].toString()
enc.AttendingDoctor = $('AttendingDoctor');
enc.ReferringDoctor = $('ReferringDoctor');
enc.ConsultingDoctor = $('ConsultingDoctor');
enc.AdmittingDoctor = $('AdmittingDoctor');
enc.PrimaryDoctor = $('PrimaryDoctor');
enc.PrimaryDoctorId = $('PrimaryDoctorId');
enc.DischargeDisposition = msg['PV1']['PV1.36']['PV1.36.1'].toString();
enc.DischargeDate = msg['PV1']['PV1.45']['PV1.45.1'].toString();
enc.SendingFacility = msg['MSH']['MSH.4']['MSH.4.1'].toString();
enc.ServicingFacility = msg['PV1']['PV1.39']['PV1.39.1'].toString();
enc.EncounterID = msg['MSH']['MSH.10']['MSH.10.1'].toString();
enc.DateProcessed = msg['MSH']['MSH.7']['MSH.7.1'].toString();
enc.Diagnosis = "";
enc.Procedures = "";
if($('Diagnosis').length>1){
	enc.Diagnosis = JSON.stringify($('Diagnosis'));
}
if($('Procedure').length>1){	
	enc.Procedures = JSON.stringify($('Procedure'));
}

channelMap.put('Encounter', validate(enc, '', new Array()));
return enc;

