	obs.SSN = msg['PID']['PID.19']['PID.19.1'].toString();
	obs.DOB = msg['PID']['PID.7']['PID.7.1'].toString();
	obs.PhoneNumber = msg['PID']['PID.13']['PID.13.1'].toString();
	obs.PatientType = msg['PV1']['PV1.18']['PV1.18.1'].toString();
	obs.AdmissionDate = msg['PV1']['PV1.44']['PV1.44.1'].toString();

	obs.DocumentIdentifier = msg['OBR'][i]['OBR.4']['OBR.4.1'].toString()
	obs.DocumentName = msg['OBR'][i]['OBR.4']['OBR.4.2'].toString()
	obs.DocumentType = msg['OBR'][i]['OBR.4']['OBR.4.3'].toString()

	obs.OrderNumber += msg['OBR'][i]['OBR.3']['OBR.3.1'].toString()

	emrdoc = getEmrDocument(msg['OBR'][i]['OBR.4']['OBR.4.2'].toString())

	obs.MnemonicCode = emrdoc.MnemonicCode
	obs.EmrDocumentName = emrdoc.EmrDocumentName
	obs.EmrDocumentType = emrdoc.EmrDocumentType
	obs.EmrDocumentId = emrdoc.EmrDocumentId

	obs.PreferredProvider = $('PreferredProvider')
	obs.ObservationDate = msg['OBR']['OBR.7']['OBR.7.1'].toString()
	obs.ObservationStatus = msg['OBX'][0]['OBX.11']['OBX.11.1'].toString()
	obs.InterestedDoctor = msg['OBX'][0]['OBX.5']['OBX.5.1'].toString().replace("Interested Provider: ","")

	obs.OrderingDoctor = $('OrderingDoctor')
	obs.AttendingDoctor = $('AttendingDoctor');
	obs.ReferringDoctor = $('ReferringDoctor');
	obs.ConsultingDoctor = $('ConsultingDoctor');
	obs.AdmittingDoctor = $('AdmittingDoctor');

	obs.PrimaryDoctor = $('PrimaryDoctor');
	obs.PrimaryDoctorId = $('PrimaryDoctorId');
	obs.SignedBy = $('SignedBy')
	obs.SignatureDetails =  $('SignatureDetails')
	obs.SendingFacility =  msg['MSH']['MSH.4']['MSH.4.1'].toString()
	obs.EncounterId =  msg['MSH']['MSH.10']['MSH.10.1'].toString()
